import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'

const exclusive = (props) => (
    <div>
        <Head>
        <script async custom-element="amp-accordion" src="https://cdn.ampproject.org/v0/amp-accordion-0.1.js"></script>
            <style amp-custom>
                {`

                @media screen and (max-width: 1024px)
                    {
                        .container_exclusive_banner {
                            background-color: #52bdae;
                            display: block;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            width:100%;
                            margin: auto;
                        }

                        .right_teal{
                            display:flex;
                        }
                        .left_teal{
                            display:block;
                        }
                        .teal_banner_line1{
                            display:block;
                            width:100%;  
                            padding-top:5%;
                            text-align:center;
                            font-size: 18px;
                            color:white;
                        }
                        .teal_banner_line2{
                            width:100%;
                            text-align:center;
                            color:white;
                            font-size: 18px;
                            display:block;
                        }
                        .teal_banner_line3{
                            font-size:1.7em;
                            width:100%;
                            text-align:center;
                            display:block;
                            font-weight: bold;
                            color:white;
                        }
                        .addtocart_cardone{
                            background-color: white;
                            display:block;
                            margin-left:5%;
                            margin-right:2%;
                            margin-bottom:5%;
                            width:45%;

                        }
                        .addtocart_cardtwo{
                            background-color: white;
                            display:block;
                            margin-right:5%;
                            margin-bottom:5%;
                            width:45%;
                        }
                        .upper{
                            background-color:#e7e6e6 ;
                            display:block;
                            text-align: center;
                            font-weight: bold;
                            margin:auto;
                            color: #58595f;
                            padding: 5% 10% 0% 10%;
                            letter-spacing:2%;
                            font-size:15px;
                        }
                        .permonth{
                            color:black;
                            text-align: center;
                            font-size: 12px;
                            color: #58595f;
                            font-weight: bold;
                            letter-spacing: 1px;
                        }
                        .instant_access{
                            color:black;
                            text-align: center;
                            font-size: 12px;
                            color: #58595f;
                            font-weight: bold;
                            letter-spacing: 1px;
                        }
                        .price{
                            background-color:#e7e6e6 ;
                            margin-top:0px;
                            text-align: center;
                            font-weight: bold;
                            margin-bottom:0px;
                            color: #58595f;
                            padding: 2% 10% 2% 5%;
                            letter-spacing: 1px;
                            font-size: 18px;
                        }
                        .addtocart_button{
                            background-color:#ed3833;
                            color: white;
                            padding:8px;
                            display: block;
                            margin:auto;
                            margin-top:10px;
                            margin-bottom:10px;
                            border-radius: 6px;
                        }
                        .brackets_shit{
                            display:block;
                            margin:auto;
                            width:100%;
                            text-align:center;
                            font-size:13px;
                            color:white;

                        }
                        .container_3buttons{
                            display:flex;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            margin-top:7%;

                        }
                         .benefits_div{
                            background-color:#e7e6e6;
                            display:flex;
                            padding-left:5%;
                            padding-right:5%;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            border-right:2px solid white;
                            width:100%;
                         }
                         .benefits_div:hover{
                             border-bottom:2px solid red;
                         }
                         .benefits{
                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .price_comp_div{
                            background-color:#e7e6e6;
                            display:flex;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            padding-left:5%;
                            padding-right:5%;
                            padding-top:2%;
                            padding-bottom:2%;
                            border-right:2px solid white;

                            width:100%;                            
                         }
                         .price_comp{

                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .faqs_div{

                            background-color:#e7e6e6;
                            display:flex;
                            padding-left:5%;
                            padding-right:5%;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            width:100%;
                         }
                         .faqs{
                            text-align:center;
                            color: #58595f;
                            font-size:10px;
                            display:block;
                            margin:auto;
                            letter-spacing:2px;
                            font-weight:bold;  
                         }
                         .section_title_wrapper{
                             text-align:center;
                             white-space:nowrap;
                             overflow:hidden;
                             display:block;
                             margin-top:5%;
                         }
                         .section_title{
                            position: relative;
                            display: inline-block;
                            font-size: 15px;
                            letter-spacing: 2px;
                            font-weight:bold;
                            color: #ed2d2f;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                         }
                         .section_title:before{
                            right: 100%;
                            margin-right: 10%;
                         }
                         .section_title:after{
                            left: 100%;
                            margin-left: 10%;
                         }
                         .section_title:before, .section_title:after{
                            content: "";
                            position: absolute;
                            top: 50%;
                            width: 9999px;
                            height: 10px;
                            background-image: initial;
                            background-position-x: initial;
                            background-position-y: initial;
                            background-size: initial;
                            background-repeat-x: initial;
                            background-repeat-y: initial;
                            background-attachment: initial;
                            background-origin: initial;
                            background-clip: initial;
                            background-color: rgb(203, 80, 87);
                         }
                         .table_wrapper{
                            display: block;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            width:100%;
                            margin-left:7%;
                         }
                         table{
                            border-collapse: collapse;
                            border: 5px solid teal;
                            width:80%;
                         }
                         td,th{
                             border:1px solid black;
                             text-align:center;
                             font-size:10px;
                         }

                    }



                `}

            </style>
        </Head>
        <body>
            <div class="container_exclusive_banner">
                <div class="left_teal" >
                    <p>
                        <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                        <p class="teal_banner_line2"> AT AN </p>
                        <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                        <p class="brackets_shit">(Adding membership to cart will unlock Exclusive prices instantly)</p>

                    </p>
                </div>
                <div class="right_teal">
                    <div class="addtocart_cardone">
                            <p class="upper"> MONTHLY </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 149/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full month.</p>
                            <h3 class="price">@ Rs. 149/-</h3>  
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                    <div class="addtocart_cardtwo">
                            <p class="upper"> ANNUAL </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 25/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full year.</p>
                            <h3 class="price">@ Rs. 299/-</h3>   
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                </div>   
                </div>    
            <div class="container_3buttons">
                    <div class="benefits_div">
                            <p class="benefits"> BENEFITS </p>
                    </div>
                    <div class="price_comp_div">
                            <p class="price_comp"> PRICE COMPARISON </p>
                    </div>
                    <div class="faqs_div">
                            <p class="faqs"> FAQS </p>
                    </div>
            </div>  
            <div class="section_title_wrapper">
                <span class="section_title">BENEFITS</span>
            </div>  
            <div class="section_title_wrapper">
                <span class="section_title">PRICE COMPARISON</span>
            </div>  
            <div class="table_wrapper">
                <table> 
                <thead><tr><th>PRODUCT</th> <th>CURRENT PRICE</th> <th>EXCLUSIVE PRICES</th></tr></thead>
                <tbody><tr><td>T-SHIRTS</td> <td class="grey">Rs. 499 - Rs. 699</td> <td>Rs. 199 onwards</td></tr> <tr><td>T-SHIRT DRESSES</td> <td class="grey">Rs. 599 - Rs. 699</td> <td>Rs. 349 onwards</td></tr> <tr><td>FULL SLEEVE T-SHIRTS</td> <td class="grey">Rs. 599</td> <td>Rs. 399 onwards</td></tr> <tr><td>TANK TOPS</td> <td class="grey">Rs. 349 - Rs. 399</td> <td>Rs. 249 onwards</td></tr> <tr><td>VESTS</td> <td class="grey">Rs. 399</td> <td>Rs. 249 onwards</td></tr> <tr><td class="text-uppercase">Boxers</td> <td class="grey">Rs. 399</td> <td>Rs. 199 onwards</td></tr> <tr><td>BACKPACKS</td> <td class="grey">Rs. 899 - Rs. 999</td> <td>Rs. 599 onwards</td></tr> <tr><td>MOBILE COVERS</td> <td class="grey">Rs. 299 - Rs. 599</td> <td>Rs. 299 onwards</td></tr> <tr><td>HOODIES</td> <td class="grey">Rs. 949</td> <td>Rs. 599 onwards</td></tr> <tr><td>SOCKS</td> <td class="grey">Rs. 249</td> <td>Rs. 99 onwards</td></tr> <tr><td>NOTEBOOKS</td> <td class="grey">Rs. 199</td> <td>Rs. 99 onwards</td></tr> <tr><td>MUGS</td> <td class="grey">Rs. 249 - Rs. 499</td> <td>Rs. 199 onwards</td></tr> <tr><td>BADGES</td> <td class="grey">Rs. 49</td> <td>Rs. 19 onwards</td></tr> <tr><td>STICKERS</td> <td class="grey">Rs. 49</td> <td>Rs. 19 onwards</td></tr> <tr><td>PINS</td> <td class="grey">Rs. 149</td> <td>Rs. 79 onwards</td></tr> <tr><td>FLIP FLOPS</td> <td class="grey">Rs. 499</td> <td>Rs. 199 onwards</td></tr> <tr><td>CAPS</td> <td class="grey">Rs. 699</td> <td>Rs. 199 onwards</td></tr> <tr><td>KEYCHAINS</td> <td class="grey">Rs. 149</td> <td>Rs. 79 onwards</td></tr></tbody>    
                </table>       
            </div>
            <div class="section_title_wrapper">
                <span class="section_title">FAQS</span>
            </div>
            <div>
                <amp-accordion animate>
                    <section>
                        <h2>Section 1</h2>
                        <p>Content in section 1.</p>
                    </section>
                    <section>
                        <h2>Section 2</h2>
                        <div>Content in section 2.</div>
                    </section>
                </amp-accordion>        
            </div>
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
